import React from 'react'
import {Link} from 'react-router-dom'
import { StyledButton } from '../Style/StyledButton'

export default function Button({label, path, del, out}) {
    return (
        <>
            {path && 
            <StyledButton>
                <Link to={path}>
                    {label}
                </Link>
            </StyledButton>
            }
            {del && 
            <StyledButton onClick={del}>
                    {label}
            </StyledButton>
            }
            {out && 
            <StyledButton onClick={del}>
                    {label}
            </StyledButton>
            }

            
        </>
    )
}
